import styles from './FeedbackBtn.module.css';

const FeedbackBtn = ({setVote}) => {
    return (
        <div>
            <h1 className={styles.header}>Please leave feedback</h1>
            <button className={styles.btn} onClick={() => setVote("democrates")} type="button">Good!</button>
            <button className={styles.btn} onClick={() => setVote("democrates")} type="button">Neutral</button>
            <button className={styles.btn} onClick={() => setVote("democrates")} type="button">Bad</button>
        </div>
    )
}

export default FeedbackBtn;
